import React from "react";

// Identité de l'hôte

export default function Proprietaire(props) {
  const endofname = props.name.indexOf(" ");
  const name = props.name.slice(0, endofname);
  const lastname = props.name.slice(endofname);
  return (
    <div className="picture-name_proprietaire">
      <h1 className="name_proprietaire">
        {name} <br /> {lastname}
      </h1>
      <img className="picture-proprietaire" src={props.avatar} alt="" />
    </div>
  );
}
